package cuny.blender.englishie.ace;

public class ConnectWords implements Comparable<ConnectWords>{
	public String words;
	public Double confidence;
	
	public ConnectWords(String words, Double confidence) {
		this.words = words;
		this.confidence = confidence;
	}

	public int compareTo(ConnectWords o) {
		// TODO Auto-generated method stub
		return words.compareTo(o.words);
	}
	public String toString(){
		return words;
	}
}
